import React, { useState } from 'react';
import GridDesigner from './GridDesigner'
import {
	BrowserRouter as Router,
	Switch,
	Route,
	Link
} from "react-router-dom";


export default function App() {
	return (
		<Router>
			<Switch>
				<Route path="/detail">
					<GridDetails />
				</Route>
				<Route path="/">
					<GridDesigner />
				</Route>
			</Switch>
		</Router>
	);
}

function GridDetails() {
	return <h2> Grid details</h2>;
}
